import { Component, OnInit } from "@angular/core";
import { HttpClient } from "@angular/common/http";
import { environment } from "src/environment/environment";
import { Router } from "@angular/router";

@Component({
  selector: "app-terrains",
  templateUrl: "./terrains.component.html",
  styleUrls: ["./terrains.component.css"],
})
export class TerrainsComponent implements OnInit {
  terrainsWithAverageRating: any[] = [];
  showPopup: boolean = false;
  popupContent: any[] = [];

  url = environment.api_url + "/reservation";

  filteredTerrains: any[] = [];

  filterType: string = "";
  filterLocation: string = "";

  constructor(private http: HttpClient, private router: Router) {}

  ngOnInit(): void {
    this.getReservations();
  }

  getReservations(): void {
    this.http.get<any[]>(this.url).subscribe(
      (terrainsWithAverageRating) => {
        this.terrainsWithAverageRating = terrainsWithAverageRating;
        this.filteredTerrains = this.terrainsWithAverageRating;
        console.log(terrainsWithAverageRating);
      },
      (error) => {
        console.error(error);
      }
    );
  }

  navigateToDetails(terrainId: number) {
    this.router.navigate(["/reservation", terrainId]);
  }

  navigateToEvaluation(terrainId: number) {
    this.router.navigate(["/evaluation", terrainId]);
  }

  navigateToGoogleMaps(url: string) {
    window.open(url, "_blank");
  }
  showPopupWindow(content: any[]) {
    this.popupContent = content;
    this.showPopup = true;
  }
  closePopup() {
    this.showPopup = false;
  }

  filterTerrains() {
    this.filteredTerrains = this.terrainsWithAverageRating.filter(
      (terrain) =>
        (this.filterType === "" ||
          terrain.typeTerrain.toLowerCase() ===
            this.filterType.toLowerCase()) &&
        (this.filterLocation === "" ||
          terrain.locationTerrain.toLowerCase() ===
            this.filterLocation.toLowerCase())
    );
  }

  clearFilters() {
    this.filterType = "";
    this.filterLocation = "";
    this.filterTerrains();
  }

  public getFormattedRating(item: any): string {
    const averageRating = item.averageRating;

    if (averageRating === 0 && item.contents.length === 0) {
      return "-";
    } else {
      return averageRating % 1 === 0
        ? Math.floor(averageRating).toString()
        : averageRating.toString();
    }
  }
}
<app-navbar></app-navbar>

<div class="page-container">
  <div class="filters">
    <div class="filter">
      <label for="type">Filtrer Par Type:</label>
      <select id="type" [(ngModel)]="filterType" (change)="filterTerrains()">
        <option value="">Tous les types</option>
        <option value="Tennis">Tennis</option>
        <option value="Football">Football</option>
        <option value="Basketball">Basketball</option>
        <option value="Volleyball">Volleyball</option>
      </select>
    </div>
    <div class="filter">
      <label for="location">Filtrer Par Commune:</label>
      <select
        id="location"
        [(ngModel)]="filterLocation"
        (change)="filterTerrains()"
      >
        <option value="">Toutes les communes</option>
        <option value="Marseille">Marseille</option>
        <option value="Aix en provence">Aix en provence</option>
        <option value="Gardanne">Gardanne</option>
        <option value="Aubagne">Aubagne</option>
      </select>
    </div>
  </div>
  <br />
  <br />

  <div class="terrain-list">
    <div *ngFor="let item of filteredTerrains" class="terrain">
      <div class="terrain-details">
        <div class="terrain-image">
          <img
            src="../../assets/Terrains/{{ item.idTerrain }}.jpg"
            alt="{{ item.nameTerrain }}"
          />
          <div class="location-box">
            <p class="location">
              <i class="bx bx-current-location"></i>
              {{ item.locationTerrain }}
            </p>
          </div>
        </div>
        <br />
        <br />

        <h3 class="terrain-name">{{ item.nameTerrain }}</h3>
        <br />
        <div class="buttons">
          <button
            class="address-button"
            (click)="navigateToGoogleMaps(item.positionTerrain)"
          >
            Adresse
          </button>
          <button
            class="address-button"
            (click)="navigateToEvaluation(item.idTerrain)"
          >
            Évaluer
          </button>
          <button
            class="address-button"
            (click)="showPopupWindow(item.contents)"
          >
            Avis
          </button>

          <button
            class="full-width-button"
            (click)="navigateToDetails(item.idTerrain)"
          >
            Réserver
          </button>
        </div>
        <p class="rating-tag">
          Rating :<b> {{ getFormattedRating(item) }}/5</b>
        </p>
      </div>
    </div>
  </div>
</div>

<div class="popup-overlay" *ngIf="showPopup" (click)="closePopup()"></div>
<div *ngIf="showPopup" class="popup-window">
  <button class="close-button" (click)="showPopup = false">X</button>
  <table>
    <thead>
      <tr>
        <th>Nom</th>
        <th>Contenu</th>
        <th>Date</th>
      </tr>
    </thead>
    <tbody>
      <tr *ngFor="let content of popupContent">
        <td>{{ content.firstName }} {{ content.lastName }}</td>
        <td>{{ content.content }}</td>
        <td>{{ content.formattedDate.split("||")[0] }}</td>
      </tr>
    </tbody>
  </table>
  <p class="emptyMessage" *ngIf="popupContent.length === 0">
    Il n'y a pas de contenu pour ce terrain.
  </p>
</div>
